        //**************************************************************************
        console.log("Criando tabela de subprefeituras");
        trans.executeSql("DROP TABLE IF EXISTS PREFECTURES", [], null, null);
        //trans.executeSql("CREATE TABLE PREFECTURES (iid INTEGER PRIMARY KEY, \
